function App () {
  return (
    <Router>
       <Routes>
        <Navbar />
        <Route exact path='/' element={<Login />} />
        <Route path='/announcements' element={<Announcements />} />
        <Route path='/projects' element={<Projects />} />
      </Routes>
    </Router> 
  );
}

export default App;
